/* white labelling theme: Green Leaf
  
  rgb(215,138,0)      gold 
  rgb(56, 26, 1)      dark brown
  rgb(84, 45, 11)     brown
  -rgb(22, 43, 0)      dark green

*/

/* ======== LOGO ======== */
.kiosk-logo {
  background-image: url('http://static1.squarespace.com/static/571fd0ad2b8dde45862b7634/t/571fd3c040261db214d19185/1471394164222');
  background-position: center 35%;
  background-size: 82%;
}
.kiosk-system__menu .uk-navbar-nav .kiosk-logo { }

.uk-navbar-nav .site-logo { }


.kiosk-logo img { display: none;}

.kiosk-categoriesMenu {  }
.kiosk-gallery { }
/* ======== CATEGORY COLORS ======== */
/*
