/* ======== MODAL ======== */
.kiosk-productModal .uk-modal-dialog { }


/* ======== BUTTONS ======== */
.kiosk-searchModal .uk-modal-dialog,
.kiosk-searchModal .uk-modal-dialog .kiosk-button-primary,
.kiosk-searchModal .uk-modal-dialog .kiosk-button-primary:hover,
.kiosk-searchModal .uk-modal-dialog .kiosk-button-primary:focus,
.kiosk-searchModal .uk-modal-dialog .kiosk-button-primary:active,
.kiosk-button-primary,
.kiosk-button-primary:hover,
.kiosk-button-primary:focus, 
.uk-button.button-primary, 
.uk-button.uk-button-primary,
.kiosk-account-menu__item {
  background-color: rgb(215,138,0);
}

.kiosk-productModal .kiosk-button-primary,
.kiosk-productModal .kiosk-button-primary:hover { background-color: rgb(215,138,0);}


    /* account dashboard + checkout */
.kiosk-sidebar__account { }
.kiosk-cart__message { }
.kiosk-button-circle { background-color: rgb(215,138,0);
}

.kiosk-cart__item .kiosk-cart__itemAmount, 
.kiosk-cart__item .kiosk-cart_itemCost {
  background-color: rgb(55, 55, 55);
  color: white;
}

button.kiosk-cart__checkout,
.kiosk-checkoutModal .kiosk-button-primary { background-color: rgb(215,138,0);}

.kiosk-productQuantity button,
.kiosk-productQuantity button:hover,
.kiosk-productQuantity button:focus,
.kiosk-productQuantity button:active {
  background-color: rgb(215,138,0);
  border-color: rgb(215,138,0);
  color: white;
}


.uk-button-dropdown .uk-dropdown li a:hover, 
.uk-button-dropdown .uk-dropdown li a:focus {
  background-color:  ;
}

.kiosk-productQuantity__input,
.kiosk-productModal .uk-button-dropdown, 
.kiosk-checkoutModal .uk-button-dropdown,
.kiosk-productModal .uk-button-dropdown .uk-dropdown  { 
  border-color: rgb(215,138,0) !important;
  background-color: transparent;
}


/* ======== NAVIGATION MENU ======== */
.kiosk-submenu .kiosk-submenu_types .uk-subnav > li.uk-active > a { color: white  ;}

.kiosk-submenu,
.kiosk-sort-container {
  background: rgb(56, 26, 1) ;
}
.kiosk-categoriesMenu .uk-navbar-nav > li.uk-active > a,
.kiosk-categoriesMenu .uk-navbar-nav > li.uk-active > a:hover { background-color: rgb(56, 26, 1);}


/* ======== CART ======== */
.kiosk-cart, .kiosk-sidebar, .kiosk-sidebar__account {  background: #333 ;}
.kiosk-sidebar__account {                               background-color: #333;}
.kiosk-sidebar__cartHeading {                           background-color: rgba(0,0,0,0.6);}
.kiosk-cart__item {                                     border: 1px solid #BCBCBC;}


/* ======== ACCOUNT ======== */
.kiosk-title-instructions { 
  background: rgb(84, 45, 11); 
  background: -moz-linear-gradient(top,  rgb(84, 45, 11) 0%, rgb(84, 45, 11) 100%);
  background: -webkit-linear-gradient(top,  rgb(84, 45, 11) 0%,rgb(84, 45, 11) 100%);
  background: linear-gradient(to bottom,  rgb(84, 45, 11) 0%,rgb(84, 45, 11) 100%);
}

.kiosk-system__menu .uk-button-link { 
  color: rgb(215,138,0) !important;
}

input.white {
  border-color: rgb(84, 45, 11) !important ;
}
